insert  into `aux_prioridade`(`id_prioridade`,`desc_prioridade`,`legenda`,`sla`,`hex_color`,`index_letra`) values (1,'Critico','O problema/solicitação/dúvida impede que a empresa realize seus processos basicos?<br/><br/>\r\n									O problema/solicitação/dúvida impede a execução de algum servico da empresa?<br/><br/>\r\n									O problema/solicitação/dúvida impede que o solicitante realize sua função?','00:30:30','#F3565D','A'),(2,'Alta','O problema/solicitação/dúvida do solicitante não o impede de realizar as atividades, mas causa retardo na execução das tarefas?','02:00:00','#DFBA49','B'),(3,'Media','O problema/solicitação/dúvida do solicitante não o impede de realizar as atividades, nem causa retardo na execução das tarefas, mas o ajudaria a fazer o trabalho melhor?<br/><br/>\r\n									O problema/solicitação/dúvida impede que do solicitante realize funcoes secundarias?','08:00:00','#89C4F4','C'),(4,'Baixa','O problema/solicitação/dúvida nao se encaixou em nenhuma das categorias? <br/></br>\r\n(!) Aqui eh preciso ter cuidado com os falsos positivos. Como nossa estrutura de atribuicao de prioridade eh simples, pode ser que algum item que caia aqui nao seja de prioridade baixa. Fique atento!','14:00:00','#C6C6C6','D');

