insert  into `eve_utilizacao_sala`(`id_utilizacao_sala`,`desc_utilizacao_sala`,`desc_definicao`,`token_id`,`token_company`,`id_usuario_criacao`,`dth_criacao`,`id_usuario_atualizacao`,`dth_atualizacao`,`sit_ativo`) values (3,'À definir pelo Cliente',NULL,'08E8A0FDCC326E741B983E971520CB29','260635a09da31c7fd54.08270071',1,'2019-09-26 15:47:48',1,'2019-09-26 15:47:48','S'),(4,'Casamento',NULL,'CA59799ABD8199080F27D6C3D7BC3A4F','260635a09da31c7fd54.08270071',1,'2019-09-26 15:48:04',1,'2019-09-26 15:48:04','S'),(5,'Cocktail',NULL,'04D655DCD65E23CB897CF0A5714FC9CE','260635a09da31c7fd54.08270071',1,'2019-09-26 15:57:57',1,'2019-09-26 15:57:57','S'),(6,'Convenção','Reunião de profissionais de uma mesma empresa ou profissionais equivalentes de empresas diferentes. Convenções podem ser de diversos tipos: vendas, lançamento de produto, congraçamento e comemorações. Debate Discussão entre dois oradores, comprometidos a defender um ponto de vista em torno de determinado assunto, o público interage somente com aplausos ou protestos não-formais.','F76E451D92352019A490BA4D9309537A','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:10',1,'2019-09-26 16:20:05','S'),(7,'Formatura',NULL,'71644203270F7AE31AF466753C5293AF','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:20',1,'2019-09-26 15:58:20','S'),(8,'Palestra','É o método de discussão mais comum. Apresenta-se questões sobre um assunto e na sequência inicia-se perguntas e debates com a platéia buscando conclusões. Pode ter como complemento demonstrações ou exercícios de laboratório.','3D7FC611D56EEF0E433473C6B000A7CE','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:30',1,'2019-09-26 16:20:50','S'),(9,'Plenario',NULL,'47118104ACA9E5B266849EA92274DC34','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:38',1,'2019-09-26 15:58:38','S'),(10,'Reunião',NULL,'3B9E05CB326A3F199124A5C0AE6C662F','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:49',1,'2019-09-26 15:58:49','S'),(11,'Sala de Apoio',NULL,'6647AEB39B716085ECADEE3DC9E8D8F4','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:06',1,'2019-09-26 15:59:06','S'),(12,'Treinamento',NULL,'75563BC8A90BFAC07B4B8CD1DB747834','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:16',1,'2019-09-26 15:59:16','S'),(13,'Workshop',NULL,'A1941CA6F8E07DAB1719746448EDEF49','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:22',1,'2019-09-26 15:59:22','S'),(14,'Congresso','É um conjunto de várias sessões de trabalho previamente definidas. Geralmente restrito a grupos associativos, categorias de profissionais ou linhas acadêmicas. Os congressos têm por objetivo de apresentar e debater assuntos de interesse específico de um segmento. Em um único congresso, pode-se ter, simultaneamente ou sequencial, palestras, conferências, mesa-redondas, debates e seminários. Um congresso também pode ser acompanhado de feiras voltadas para o público presente.','98276169E8ADC084175E010323FB0DEB','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:46',1,'2019-09-26 16:18:13','S'),(15,'Conferência','É a exposição feita por uma autoridade em um determinado assunto para um grande número de pessoas. Conta com a presença de um presidente de mesa para condução da apresentação, segue uma linha mais formal que uma palestra. Na conferência, perguntas são feitas somente por escrito e devidamente identificadas ao término da apresentação.','77E51583497446B7F7CB88CBA0DC12E9','260635a09da31c7fd54.08270071',1,'2019-09-26 16:00:00',1,'2019-09-26 16:58:48','S'),(16,'Fórum','É uma reunião baseada na busca da participação intensa da platéia, preferencialmente formada por um grande número de pessoas. Um coordenador dá o tema de interesse geral e busca a opinião da platéia. Ocorre um debate livre até que conclusões possam ser obtidas.','A4EA6819A87CDA0B3D09F8C90123117B','260635a09da31c7fd54.08270071',1,'2019-09-26 16:00:24',1,'2019-09-26 16:20:17','S'),(17,'Mesa redonda','Reunião com um tempo específico para o questionamento pelos especialistas convidados das teses apresentadas pelos colegas. Há ampla discussão antes mesmo da participação da audiência.','CDDE0F84BA23269DA37CA493E06F28E0','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:04',1,'2019-09-26 16:20:28','S'),(18,'Painel','Reunião questionadora, que se resume para um grande grupo o teor de apresentações feitas por um grupo menor, ficando este disposto de preferência em mesa de semicírculo com o presidente ao centro. Há ampla discussão e, geralmente, discussões polêmicas.','ACE29C0981E6A801EB2BBF1D9DBA701A','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:12',1,'2019-09-26 16:20:37','S'),(19,'Simpósio','É uma reunião de especialistas de renome, sob a direção de um moderador, para apresentação de tema científico à um público específico. Os especialistas desenvolvem partes de um mesmo tema, e posteriormente entre si desenvolvem uma fase de debate. O coordenador do simpósio apresenta os especialistas e introduz os tópicos de cada assunto. O público participa somente no final, com perguntas escritas e identificadas, de caráter complementar, sem teor de polêmica.','0495813C3DDB29C25F9210601438A049','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:23',1,'2019-09-26 16:21:04','S'),(20,'Seminário','É uma sequência de atividades para desenvolver capacidades, conhecimento e aprendizagem por meio de instrutores especializados. O objetivo é somar informações e experiências, sem a necessidade de chegar a conclusões ou resultados. Um seminário pode durar um dia ou até várias semanas.','4E3C80A504280BAB9DFA2CC89B9B8E5B','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:32',1,'2019-09-26 16:21:15','S'),(21,'Brainstorming','Realiza-se através da estimulação livre do mente dos participantes para estimular a ideias com vista à solução de problemas. Grupos de pessoas são orientadas a emitir ideias sobre uma questão, que vão sendo trocadas e aperfeiçoadas sem juízo prévio de valor.','2BC4B15BBCB175578481E18CB25EC391','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:37',1,'2019-09-26 16:21:29','S');

